    const year = parseInt(yearInput.value);

    try {
      const response = await fetch("https://ventas-api-518727385555.europe-west1.run.app/predict", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ item, store_code, week, year }),
      });

      if (!response.ok) throw new Error("Request failed with status " + response.status);

      const data = await response.json();

      // Hide form and display results
      formContainer.style.display = "none";
      resultContainer.style.display = "block";

      resultContainer.innerHTML = `
        <h2>Resultados</h2>
        <p><strong>Producto:</strong> ${data.item}</p>
        <p><strong>Tienda:</strong> ${data.store_code}</p>
        <p><strong>Semana:</strong> ${data.week}</p>
        <p><strong>Año:</strong> ${data.year}</p>
        <p><strong>Ventas estimadas semanales:</strong> ${data.week_predictions}</p>
        <table style="margin: 0 auto; border-collapse: collapse;">
          <thead>
            <tr><th style="padding: 8px; border-bottom: 1px solid #ccc;">Fecha</th><th style="padding: 8px; border-bottom: 1px solid #ccc;">Ventas estimadas</th></tr>
          </thead>
          <tbody>
            ${data.predictions.map(p =>
              `<tr>
                <td style="padding: 8px;">${p.date}</td>
                <td style="padding: 8px;">${p.predicted_sales}</td>
              </tr>`).join("")}
          </tbody>
        </table>
        <br><button id="backButton">Volver</button>
      `;

      // Add back button listener
      document.getElementById("backButton").addEventListener("click", () => {
        resultContainer.style.display = "none";
        formContainer.style.display = "block";
      });

    } catch (error) {
      resultContainer.innerHTML = `<p style="color: red;">Error: ${error.message}</p>`;
      resultContainer.style.display = "block";
      formContainer.style.display = "none";
    }
